def ave(array):
    result = []
    for i in range(len(array[0])):
        result.append(np.mean(array[:, i]))
    return result


def final(LASSO, Normal, One, DECC_DG, DECC_D, DECC_G, CCDE_LASSO):
    LASSO_final = LASSO[:, len(LASSO[0])-1]
    Normal_final = Normal[:, len(Normal[0]) - 1]
    One_final = One[:, len(One[0]) - 1]
    DECC_DG_final = DECC_DG[:, len(DECC_DG[0]) - 1]
